    return (
        <div className="checkout">
          <img className="checkout_ad" src="
          https://images-na.ssl-images-amazon.com/images/G/02/UK/CCMP/TM/DCC_Amazon1._CB423492668_.jpg" 
          alt=""
          />
        </div>
    );
}

export default Checkout;
